import React, { useState } from "react";
import logo from "./logo.svg";
import "./App.css";
import { Food } from "./models/Food";
import { FoodData } from "./testData/FoodData";
import { foodTile } from "./models/FoodComp";

function App() {
  const [food, setFood] = useState<Food[]>(FoodData);

  return <div className="App">{food.map((data, index) => foodTile(data))}</div>;
}

export default App;
